import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
  return (
    <div className="ui container comments">
      <CommentDetail author={faker.name.firstName()} comment={faker.lorem.sentence()} timeAgo="Today at 4:45pm" />
      <CommentDetail author={faker.name.firstName()} comment={faker.lorem.sentence()} timeAgo="Today at 6:00pm" />
      <CommentDetail author={faker.name.firstName()} comment={faker.lorem.sentence()} timeAgo="Today at 2:15pm" />
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector('#root'));
